import React, { Component } from "react";
import { Row, Col } from "react-bootstrap";

export class CastList extends Component {
  render() {
    const { cast } = this.props;
    return (
      <Row className="text-center r">
        {cast.map((cur, i) => {
          return (
            <Col key={i}>
              <img
                alt={cur.name}
                style={{
                  maxWidth: "140px",
                  borderRadius: "10px"
                }}
                src={`http://image.tmdb.org/t/p/original/${cur.profile_path}`}
              />

              <h4 className="p-2 mt-2">{cur.name}</h4>
              <p>{cur.character}</p>
            </Col>
          );
        })}
      </Row>
    );
  }
}

export default CastList;
